import React from 'react';
import { FaFileAlt } from 'react-icons/fa';
import './PageIcon.css';

const PageIcon = ({ thumbnail }) => (
  <div className="page-icon">
    {thumbnail ? <img src={thumbnail} alt="Thumbnail" /> : <FaFileAlt />}
  </div>
);

export default PageIcon;
